import React from "react";
import "./App.css";
import { Header } from "./components/Header";
import { Description } from "./components/Description";
import { Categories } from "./components/Categories";
import { Footer } from "./components/Footer";

function App() {
  return (
    <div className="App">
      <Header />
      <Description />
      <Categories />
      <Footer />
    </div>
  );
}

export default App;
